import View from '../views/AutocompleteControl'
import {CountryInfo, getCountryByName} from "../../api/apiService";
import {FC, useState} from "react";
import {ControllerProps} from "../@types/AutocompleteControl";

const AutocompleteControl:FC<ControllerProps> = (props) => {

  const [sortCountries, setSortCountries] = useState<CountryInfo[]>([])
  console.log(props.viewModel)
  const getSearchCountriesAsync = async (e: any) => {
    const countries = await getCountryByName(e.target.value)
    setSortCountries(countries)
  }

  return (
    <View/>
  )
}

export default AutocompleteControl
